import React from 'react';
import { render } from 'react-dom';
import './person.css'

const person = (props)=> {
    return (
        <div className="Person">
            <p onClick={props.click}>I'm {props.name} and I am {props.age} years old!</p>
            <p>{props.children}</p>
            <input onChange={props.changed}></input>
        </div>
    )
}

export default person;
